import React from 'react';
import classes from './Post.module.css';

const Content = () => {
    return(

    <div className={classes.content}>
        
        
       
       
        
        
          <div className={classes.item}><img src='https://static.news.ru/photo/c47d9f48-5707-11e9-8021-fa163e074e61_660.jpg'></img>POST 1</div>
          
          
      </div>
    )
}

export default Content;
